import React, { Component } from 'react';
import defaultOptionenWithOutAuth from '../helpers/defaultOptionenWithOutAuth';
//import DefaultOptionen from '../helpers/defaultOptions'
export class Button extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            name: '',
            surname: '',
            email: '',
            password: ''
        };
    }
    registration = (event) => {
        event.preventDefault();
    
        fetch('http://localhost:3300/user', {
            headers: defaultOptionenWithOutAuth.headers,
            method: 'POST',
            body: JSON.stringify({ name: this.props.name, surname: this.props.surname, email: this.props.email, password: this.props.password })
        })
            .then(response => response.json())
            .then(data => {
            //this.props.history.push("/login");
            });
    }

}
